import { Link } from "react-router-dom";
import SplingLogo from "../assets/img/splingLogo.png";

export function Header() {
  return (
    <header>
      <nav className="nav naim flex">
        <Link to="/">
          {/* <h1 className="logo"> */}
            <img src={SplingLogo} className="logo-img" alt="logo-img" />
          {/* </h1> */}
        </Link>
      </nav>
    </header>
  );
}
